import React, { memo } from "react";

import { PanelWrapper } from "./style";

export default memo(function LJPlayerList() {
  return (
    <PanelWrapper>
      <LJPlayerHeader />
      <div className="main">
        <img className="image" src="" alt="" />
        <LJPlayerList />
        <LJPlayerLyric />
      </div>
    </PanelWrapper>
  );
});
